I felt overwhelmed, lost and rapidly burning out. Then I took some time out to reflect on why I felt this way. Why was it I continually felt like I was peddling hard on the hamster wheel yet just not going any where fast? 

I quickly realized I was busy "doing" but not busy moving my needle forward. But did I know where I wanted to point my needle? The answer was yes but "life" had just got in the way. 

Once I took my focus back to my Goals and my Vision it was crazy everything became much easier and simpler too. I became happier, much happier. My Purpose and Meaning in life also stormed back in droves.

It was my epiphany moment!! 

How did I do this? Good question. Like most things in life I keep it simple, the simpler it is the the bigger I find the changes to be. So every morning I check in with myself while I am showering (I have this pinned to my shower wall) and ask myself two questions.

1️⃣ What's my purpose? 2️⃣ Why am i doing what I do? 
By checking in daily it reminds me during the day to stay the course, to stay due North.

Over the coming days I will expand on this routine for you because it was the basis behind massive gains in my life.

Hope you gained something from this, let me know.

